import HomeIco from "../img/home.svg";
import './stytle.scss'
import ClassNames from "classnames/bind";
import {useState} from "react";


const NavigationItem = ({img, value, id, active, }) => {

    const [state, setState] = useState("transport");


    const classNames = ClassNames("batman-store__header-container_navigation-list-item", {
        "batman-store__header-container_navigation-list-item--active": active,
    });



    return (

        <li className={classNames}  onClick={()=> setState(id)}>{img ? (<img src={img} alt="HomeIco"/>) : null}
            {value}</li>
    )

}

export default NavigationItem
